import React from 'react';

function ExerciseSet(props) {
    const [workouts] = props.workouts


    return (
        <div>
        <h2>Make a customized set by selecting from the following workouts</h2>
         {workouts.map((workout) => (
                <li key={workout.name}>
                  <button 
                    className={`Button-${workout.name}`}>{workout.name}</button>
                </li>
              ))}
        <div className='list'></div>
        <button onClick={// reloads the page so that the main menu comes back]
        () => window.location.reload()}>
        Back
      </button>
        </div>
    );
}

export default ExerciseSet;
